import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "../components/Login";

const Routing = () => {

    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" index element={<Login />} />
            </Routes>

        </BrowserRouter>
    )   }


export default Routing;
